import { createSlice, createAsyncThunk } from '@reduxjs/toolkit'
import Axios from '../Axios'



export const fetchOrder = createAsyncThunk('Order/fetchCart', async () => {
    const response = await Axios.get('/order').then(res => res.data.order)
    return response
})
export const OrderSlice = createSlice({
    name: 'order',
    initialState: {
        Orderinfo
    },
    reducers: {
        addToCart: (state, action) => {
        }
    },
    extraReducers: {
        [fetchOrder.fulfilled]: (state, action) => {
            state.paymentType = action.payload.paymentType
            state.paymentStatus = action.payload.paymentStatus
            state.products = action.payload.products
            state.address = action.payload.address
            state.total = action.payload.total
            state.orderAt = action.payload.orderAt

        }
    }
})
export default OrderSlice.reducer;
